class signIn extends Component {


    render() {
        return (
            <Form>
                <div class="form-group row" >
                    <label class="col-sm-2 col-form-label"> E-Mail: </label>
                    <div class="col-sm-10">
                        <input type="email" class="form-control" />
                    </div>
                </div>

                <div class="form-group row">
                    <label class="col-sm-2 col-form-label"> Password: </label>
                    <div class="col-sm-10">
                        <input type="password" class="form-control"/>
                    </div>
                </div>

                <div class="form-group row">
                    <div class="col-sm-10">
                        < button type="submit" class="btn btn-primary" onClick={() => alert('submit button')} > Se Connecter</ button >
                    </div>
                </div>

                <div class="form-group row">
                    <div class="col-sm-10">
                        < button type="danger" class="btn btn-secondary" onClick={() => alert('password button')} > Mdp oubli√© ? </ button >
                    </div>
                </div>

            </Form >
        );
    }

}
export default signIn;
